## Create a Tooltip in NextJS using React Context

### Step 1: Create a Tooltip Context

Create a new file called TooltipContext.js and add the following code:
```
import React, { createContext, useState } from "react";

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ tooltip, setTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```
### Step 2: Create a Tooltip Component

Create a new file called Tooltip.js and add the following code:
```
import React, { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

export const Tooltip = ({ children, tooltip }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div>
      {children}
      <div
        className="tooltip"
        style={{
          display: tooltip ? "block" : "none",
          position: "absolute",
          top: tooltip.y,
          left: tooltip.x,
        }}
      >
        {tooltip.text}
      </div>
    </div>
  );
};
```
### Step 3: Use the Tooltip Component

Now we can use the Tooltip component in our application. For example, we can create a button that displays a tooltip when clicked:
```
import { TooltipProvider } from "./TooltipContext";
import { Tooltip } from "./Tooltip";

export default function App() {
  return (
    <TooltipProvider>
      <div>
        <Tooltip tooltip={{ text: "Hello World", x: 100, y: 100 }}>
          <button>Click me</button>
        </Tooltip>
      </div>
    </TooltipProvider>
  );
}
```
### Step 4: Add CSS Styles

Finally, we can add some CSS styles to make the tooltip look nice:
```
.tooltip {
  background-color: #333;
  color: #fff;
  padding: 10px;
  border-radius: 5px;
  box-shadow: 0 0 5px #333;
}
```
And that's it! We have created a Tooltip component in NextJS using React Context. The Tooltip component can be used in any part of the application and will work as expected.

